import Button from '@mui/material/Button';
import {Add,Margin,Settings} from '@mui/icons-material';
import Typography from '@mui/material/Typography';



function App() {
  return (
    <div>
      <Button variant="text">Text</Button>
      <Button 
      startIcon={<Settings/>} 
      variant="contained" 
      color='secondary' 
      size='small'>Contained</Button>

      <Button 
      startIcon={<Add/>} 
      variant="contained" 
      color='success' 
      size='small'>Add new post</Button>

      <Button variant="outlined" disabled>Outlined</Button>

      <Typography variant="h1" component="p">
        It uses h1 style but it's a p tag.
      </Typography>
      <button
      variant="contained" sx = {{
        backgroundColor:"skyblue",
        color:"#888",
        Margin: 5,
      }}
      >
        My unique Button
      </button>

    </div>
  );
}

export default App;
